import React from 'react';
import ClubCard from"./ClubCard";

function ClubSearch({clubs, user}) {

    const clubComponents = clubs.map((club) =>
        <ClubCard
        key={club.id}
        club={club} 
        />
    )

    return(
        <div>
            {clubComponents}
            <button>Create a Club!</button>
        </div>
    )
}
export default ClubSearch
